$("#euroCompra").html("$"+ parseFloat($(xml).find('divisas').find("row[divisa=\"EURO\"]").attr('compra')).toFixed(2));
$("#euroVenta").html("$"+ parseFloat($(xml).find('divisas').find("row[divisa=\"EURO\"]").attr('venta')).toFixed(2));
